(18,'news','News',51,'Global Chip Shortage Begins to Ease','Manufacturers report improved supply chain conditions after two years of semiconductor shortages.\nConsumer electronics and automotive sectors are expected to stabilize.\n\n','After causing widespread disruptions across various industries, the global chip shortage appears to be easing, thanks to expanded manufacturing capacity and government intervention. Major chipmakers such as TSMC and Intel have ramped up production and opened new fabs in strategic locations. Analysts predict that normal production levels could resume by the end of the year, with a positive impact on electronics pricing and vehicle availability.'),
(19,'news','News',54,'Electric Vehicles Gain Popularity Amid Rising Fuel Prices','New satellite imagery reveals potential underground water on Mars.\nThe discovery could have major implications for future human exploration.','NASA&#039;s latest Mars orbiter has detected what appears to be a subsurface reservoir of liquid water beneath the Martian surface near the planetâ€™s south pole. Using ground-penetrating radar, scientists observed distinct reflections consistent with briny water trapped under layers of ice. If confirmed, this discovery could boost the feasibility of long-term human colonization on Mars and provide crucial resources for future missions. Further robotic exploration is expected to follow in the coming months.'),
(20,'news','News',55,'Tech Giants Collaborate on New AI Standard','Leading tech companies have announced a joint effort to create common AI standards.\nThe initiative aims to improve transparency and ethical use of artificial intelligence.','In a groundbreaking move, several major technology firms including OpenAI, Google, and Microsoft have formed a consortium to establish a global framework for responsible AI development. The group plans to outline best practices for data usage, model training, and algorithm fairness. Experts believe this could be a major step toward mitigating the risks associated with AI misuse while fostering innovation in a more ethical and inclusive environment.'),
(21,'news','News',56,'Test News Item','Test news item object.','This is a test news item object. test test test test test test test test test test test test test test test test'),
(23,'news','News',65,'Renewable Energy Surpasses Fossil Fuels in Europe','For the first time in history, Europe generated more electricity from renewables than fossil fuels.\nThe shift marks a pivotal moment in the continentâ€™s energy transition strategy.','According to data released by the European Energy Agency, wind, solar, and hydroelectric sources produced 52% of Europeâ€™s electricity in the first quarter of the year. This marks the first time renewables have overtaken coal and gas in total energy output. Governments and environmental groups have hailed the milestone as a sign that climate policies and green investments are beginning to yield tangible results. Experts say continued investment and policy reform will be necessary to sustain the momentum.');
